import React from 'react';
import { Outlet } from 'react-router-dom';
import Book from '../Book';

function Layout() {
  return (
    <div style={{ display: 'flex', flexDirection: 'column' }}>
      <Book />
      <Outlet />
    </div>
  );
}

export default Layout;
